    "2016-11-25T21:06:25.253821",nt"name": "national-assessment-of-educational-progress-2004",nt"isopen":
    true,nt"url": null,nt"notes": "The National Assessment of Educational Progress,
    2004 (NAEP 2004), is a study that is part of the National Assessment of Educational
    Progress (NAEP) program; program data is available since 1990 at <http://nces.ed.gov/nationsreportcard/naepdata/>.
    NAEP 2004 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
    assesses what America's students know and can do in foreign language assessment.
    The study was conducted using paper and pencil assessments of students. Students
    in grade 12 were sampled for the field test in 2003. The field test collection's
    response rate was between 90 and 92 percent. Key statistics produced from NAEP 2004
    are results on foreign language assessment achievement, instructional experiences,
    and school environments for students and groups within those populations (e.g. female
    students, Hispanic students).",nt"license_title": "Creative Commons CCZero",nt"extras":
